import { Breadcrumb as BaseBreadcrumb, } from "@microsoft/fast-components-react-base";
import breadcrumbSchema from "./breadcrumb.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { BreadcrumbStyles } from "@microsoft/fast-components-styles-msft";
/* tslint:disable-next-line:typedef */
const Breadcrumb = manageJss(BreadcrumbStyles)(BaseBreadcrumb);
export { Breadcrumb, breadcrumbSchema, };
